DROP TABLE IF EXISTS fact;
CREATE TABLE fact (license VARCHAR(25) NOT NULL, code VARCHAR(25) NOT NULL, meetid VARCHAR(25) NOT NULL, swimstylecode VARCHAR(25) NOT NULL, agegroupid VARCHAR(25) NOT NULL, points INT, swimtime TIME, place INT, PRIMARY KEY (license, code, meetid, swimstylecode,agegroupid));
DROP TABLE IF EXISTS swimstyle;
CREATE TABLE swimstyle (swimstylecode VARCHAR(25) NOT NULL, distance INT, stroke VARCHAR(25), relaycount VARCHAR(25), PRIMARY KEY (swimstylecode));
DROP TABLE IF EXISTS meet;
CREATE TABLE meet (meetid VARCHAR(25) NOT NULL, name VARCHAR(75), course VARCHAR(25), city VARCHAR(25), nation VARCHAR(25), startdate DATE, enddate DATE, PRIMARY KEY (meetid));
DROP TABLE IF EXISTS athlete;
CREATE TABLE athlete (license VARCHAR(25) NOT NULL, firstname VARCHAR(50), lastname VARCHAR(25), gender VARCHAR(25), birthdate DATE, nation VARCHAR(25), PRIMARY KEY (license));
DROP TABLE IF EXISTS club;
CREATE TABLE club (code VARCHAR(25) NOT NULL, name VARCHAR(50), nation VARCHAR(25), region VARCHAR(25), PRIMARY KEY (code));
DROP TABLE IF EXISTS agegroup;
CREATE TABLE agegroup (agegroupid VARCHAR(25) NOT NULL, minage INT, maxage INT, PRIMARY KEY (agegroupid));
ALTER TABLE fact ADD CONSTRAINT meetmeetidfact FOREIGN KEY (meetid) REFERENCES meet (meetid) ON DELETE NO ACTION ON UPDATE NO ACTION;
ALTER TABLE fact ADD CONSTRAINT swimstyleswimstylecodefact FOREIGN KEY (swimstylecode) REFERENCES swimstyle (swimstylecode) ON DELETE NO ACTION ON UPDATE NO ACTION;
ALTER TABLE fact ADD CONSTRAINT athleteathleteidfact FOREIGN KEY (license) REFERENCES athlete (license) ON DELETE NO ACTION ON UPDATE NO ACTION;
ALTER TABLE fact ADD CONSTRAINT clubclubidfact FOREIGN KEY (code) REFERENCES club (code) ON DELETE NO ACTION ON UPDATE NO ACTION;
ALTER TABLE fact ADD CONSTRAINT agegroupagegroupidfact FOREIGN KEY (agegroupid) REFERENCES agegroup (agegroupid) ON DELETE NO ACTION ON UPDATE NO ACTION;

